// src/components/LoginPage.js
import React from "react";
import { Link } from "react-router-dom";

export default function LoginPage() {
  return (
    <div className="min-h-screen bg-gray-100 pt-16"> {/* Add pt-16 to push content below the navbar */}
    <div className="bg-white p-8 rounded-lg shadow-lg max-w-sm mx-auto mt-8">
      <h1 className="text-3xl font-semibold text-center mb-6">Login</h1>

        <form className="space-y-4">
          <input type="email" placeholder="your@email.com" className="w-full border border-gray-300 rounded-lg py-2 px-4 focus:outline-none focus:ring-2 focus:ring-red-600"/>
          <input type="password" placeholder="password" className="w-full border border-gray-300 rounded-lg py-2 px-4 focus:outline-none focus:ring-2 focus:ring-red-600"/>
          <button type="submit" className="w-full bg-red-600 text-white py-2 px-4 rounded-lg hover:bg-red-600 focus:outline-none focus:ring-2 focus:ring-red-600">
          Login
          </button>
        </form>

        <div className="text-center mt-4 text-gray-600">
          Don't have an account yet?{" "}
          <Link className="text-black underline" to="/register">
            Register now
          </Link>
        </div>
      </div>
    </div>
  );
}
